try {
    final String unescapedURL = URLDecoder.decode(url, StandardCharsets.UTF_8.name());
    final String encodedUrl = unescapedURL.replaceAll("\"", "%22")
            .replaceAll("'", "%27")
            .replaceAll(">", "%3E")
            .replaceAll("<", "%3C")
            .replaceAll("`", "%60")
            .replaceAll(" ", "%20");

    int qMarkIx = encodedUrl.indexOf('?');
    if (qMarkIx > 0) {
        final String urlBeforeQuestionMark = encodedUrl.substring(0, qMarkIx);
        final String urlAfterQuestionMark = encodedUrl.substring(qMarkIx);
        // Regex will fail to match if encodedUrl contains no colon, in which case we get the original URL back.
        final String encodedUrlWithoutColons = urlBeforeQuestionMark + urlAfterQuestionMark.replaceAll(":", "%3A");
        if (xssFilter.isValidHref(encodedUrlWithoutColons)) {
            return encodedUrlWithoutColons;
        }
    }

    final String mangledUrl = mangleNamespaces(encodedUrl);
    if (xssFilter.isValidHref(mangledUrl)) {
        return mangledUrl;
    }
} catch (final UnsupportedEncodingException e) {
    LOGGER.error("Unable to decode url: {}.", url);
}

